import React, { useState, useEffect } from 'react';
import { Shield, Activity, Bell } from 'lucide-react';
import SensorCard from './components/SensorCard';
import ActuatorControl from './components/ActuatorControl';
import ChartSection from './components/ChartSection';
import AlertLog from './components/AlertLog';

const Dashboard = () => {
  const [sensorData, setSensorData] = useState({
    gasLevel: 0,
    flameDetected: false,
    temperature: 0,
    humidity: 0,
    exhaustFan: false,
    waterPump: false,
    alarm: false
  });

  const [history, setHistory] = useState([]);
  const [alerts, setAlerts] = useState([]);

  useEffect(() => {
    const interval = setInterval(() => {
      const newData = {
        gasLevel: Math.floor(Math.random() * 1000),
        flameDetected: Math.random() > 0.9,
        temperature: 25 + Math.random() * 10,
        humidity: 50 + Math.random() * 20,
        exhaustFan: false,
        waterPump: false,
        alarm: false,
        timestamp: new Date().toLocaleTimeString()
      };

      if (newData.gasLevel > 600) {
        newData.exhaustFan = true;
        newData.alarm = true;
        addAlert('Gas Berbahaya Terdeteksi!', 'danger');
      }

      if (newData.flameDetected) {
        newData.waterPump = true;
        newData.alarm = true;
        addAlert('Api Terdeteksi!', 'critical');
      }

      if (newData.temperature > 32) {
        newData.exhaustFan = true;
        addAlert('Suhu Tinggi', 'warning');
      }

      setSensorData(newData);
      
      setHistory(prev => {
        const updated = [...prev, {
          time: newData.timestamp,
          gas: newData.gasLevel,
          temp: newData.temperature.toFixed(1),
          humidity: newData.humidity.toFixed(1)
        }];
        return updated.slice(-15);
      });
    }, 2000);

    return () => clearInterval(interval);
  }, []);

  const addAlert = (message, type) => {
    const newAlert = {
      id: Date.now(),
      message,
      type,
      time: new Date().toLocaleTimeString()
    };
    setAlerts(prev => [newAlert, ...prev].slice(0, 5));
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-900 via-gray-800 to-gray-900 text-white p-6">
      <div className="mb-8">
        <div className="flex items-center justify-between">
          <div>
            <h1 className="text-4xl font-bold mb-2 flex items-center gap-3">
              <Shield className="text-blue-400" size={40} />
              Industrial Safety Monitor
            </h1>
            <p className="text-gray-400">Real-time Environment & Safety Monitoring System</p>
          </div>
          <div className="flex items-center gap-2 bg-green-500/20 px-4 py-2 rounded-lg border border-green-500/50">
            <Activity className="text-green-400 animate-pulse" size={20} />
            <span className="text-green-400 font-semibold">System Online</span>
          </div>
        </div>
      </div>

      {(sensorData.alarm || sensorData.flameDetected) && (
        <div className="mb-6 bg-red-500/20 border-2 border-red-500 rounded-lg p-4 animate-pulse">
          <div className="flex items-center gap-3">
            <Bell className="text-red-500" size={24} />
            <div>
              <h3 className="font-bold text-red-500 text-lg">PERINGATAN SISTEM!</h3>
              <p className="text-red-300">
                {sensorData.flameDetected && "Api terdeteksi! "}
                {sensorData.gasLevel > 600 && "Gas berbahaya terdeteksi! "}
                Aktuator otomatis telah diaktifkan.
              </p>
            </div>
          </div>
        </div>
      )}

      <SensorCard sensorData={sensorData} />

      <div className="grid grid-cols-1 lg:grid-cols-3 gap-6 mb-8">
        <ChartSection history={history} />
        <ActuatorControl sensorData={sensorData} />
      </div>

      <AlertLog alerts={alerts} />
    </div>
  );
};

export default Dashboard;
